	"sap/suite/ui/generic/template/fragments/MessageDialog.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core"><Dialog class="sapUiNoContentPadding" state="{settings>/state}" type="Message" afterClose="afterClose"\n\t\tshowHeader="true" horizontalScrolling="false" draggable="true"\n\t\tcontentHeight="440px" contentWidth="440px" verticalScrolling="false"><content><MessageView items="{settings>/messages}" showDetailsPageHeader="false" itemSelect="onMessageSelect" groupItems="{settings>/grouping}"><MessageItem type="{settings>type}" title="{settings>message}" description="{settings>description}"\n\t\t\t\t\t\t\tlongtextUrl="{settings>descriptionUrl}" groupName="{= ${settings>/messageToGroupName}[${settings>id}] || ${settings>/genericGroupName} }" /></MessageView></content><customHeader><Bar><contentMiddle><Text text="{settings>/title}" /></contentMiddle><contentLeft><Button icon="sap-icon://nav-back" visible="{settings>/backButtonVisible}" press="onBackButtonPress"/><core:Icon\n\t\t\t\t\t\tsrc="{path: \'settings>/state\', formatter: \'sap.suite.ui.generic.template.js.AnnotationHelper.getSeverityIconFromIconPool\'}"\n\t\t\t\t\t\tcolor="{path: \'settings>/state\', formatter: \'sap.suite.ui.generic.template.js.AnnotationHelper.getIconColor\'}"\n\t\t\t\t\t/></contentLeft></Bar></customHeader><buttons><Button text="{settings>/actionButtonText}" visible="{settings>/showActionButton}" press="onActionButtonPressed"  type="Emphasized"/><Button text="{=${settings>/showActionButton} ? ${settings>/cancelButtonText} : ${settings>/closeButtonText}}" press="onMessageDialogClose"/></buttons></Dialog></core:FragmentDefinition>\n',
